$('#guestiden').change(function() {
if ($('#guestiden').prop('checked')) {
    $('#regionadddiv').show();
    $('#regionselect').prop("required", true);
    $('#divselect').prop("required", true);
    } else {
    $('#regionadddiv').hide();
    $('#regionselect').prop("required", false);
    $('#divselect').prop("required", false);
    }
});

$(document).ready(function () {
    $("form").submit(function (event) {

    var formData = {
    visitor: $("#visitor").val().trim(),
    visited: $("#visited").val().trim(),
    date: $("#datepicker").val().trim(),
    visitorHidden: $("#visitorHidden").val().trim(),
    visitedHidden: $("#visitedHidden").val().trim(),
    guestIden: $("#guestiden").val().trim(),
    guestregion: $("#regionselect").val().trim(),
    guestdiv: $("#divselect").val().trim()
    };

    $.ajax({
    type: "POST",
    url: "",
    data: formData,
    dataType: "json",
    encode: true,
    success: function (data) {
        Success = true;
        console.log(data);
        $(':input').val('');
        $('#countSpan').text(data);
        $('input:checkbox').removeAttr('checked');
        if ($('#guestiden').prop('checked')) {
            $('#regionadddiv').show();
            $('#regionselect').prop("required", true);
            $('#divselect').prop("required", true);
        } else {
            $('#regionadddiv').hide();
            $('#regionselect').prop("required", false);
            $('#divselect').prop("required", false);
        }
        alert("Thank you! Home Visit saved successfully.");
    },
    error: function (textStatus, errorThrown) {
        Success = false;
        alert("Failed saving Home Visit : " + errorThrown);
    }
    });
    event.preventDefault();
    });
});

